import { BrowserRouter as Router, Route,Routes } from 'react-router-dom';
import Login from'./login.js';
import AuthCode from './AuthCode.jsx'


function App() {
  return (
    <Router>
    <div>
        <Routes>
        <Route path="/authcode" component={AuthCode}/>
        <Route  path='/' component={Login}/>
        </Routes>
    </div>
    </Router>

  );
}



export default App;
